export class Monster {
    constructor(name, level, strength, monsterHP, monsterGP, monsterExperience) {
        this.name = name;
        this.level = level;
        this.strength = strength;
        this.monsterHP = monsterHP;
        this.monsterGP = monsterGP;
        this.monsterExperience = monsterExperience;
    }
}
